import { StyleSheet } from 'react-native';

export default StyleSheet.create(
    {
        card: {
            display: 'flex',
            flexDirection: 'row',
            margin: 10,
            alignItems: 'center', 
            borderWidth: 1,
            borderColor: '#000',
            backgroundColor: '#fff'
        },
        img:{
            height: '40vh',
            marginRight: 10,
        }
    }
);
